import { SET_GRID_SIZE } from "../actions/types";

const initialState = {
	height: 250,
	width: 250,
	showModal: false
};

export default function(state = initialState, action) {
	switch (action.type) {
		case SET_GRID_SIZE:
			console.log(action);
			return {
				...state,
				height: action.payload.height,
				width: action.payload.width,
				showModal: action.payload.modal
			};
		default:
			return state;
	}
}
